import portrait from "../media/gPortrait.jpeg";

export default function Home() {
   return (
      <div className="container">
         <div className="flex justify-center">
            <img
               src={portrait}
               alt="Angi plays cello"
               className="w-full md:w-1/2"
            />
         </div>
         <div className="absolute top-0 left-1/2 -translate-x-1/2 text-2xl font-semibold animate-pulse">
            Hi, and welcome!
         </div>
         <div className="text-center">
            <p className="text-lg">
               I'm Angelina, a cello player, singer, and music aficionado.
            </p>
         </div>
      </div>
   );
}
